function LineGraph() {
  const [chartData, setchartData] = useState({});

  useEffect(() => {
    fetch("https://disease.sh/v3/covid-19/historical/all?lastdays=120")
      .then((response) => response.json())
      .then((data) => {
        // setchartData(data);
        console.log("Hello");
        console.log(data);
      });
  }, []);

  return (
    <div>
      <h1>Hello</h1>
    </div>
  );
}

export default LineGraph;
